 @emersonsilva442  Nossa seus argumentos são muito bons kkkkk parece que foram escritos por uma criança de 8 anos.

Aqui vai algumas curiosidades de adulto pra você:
1- O Flamengo é superior ao Grêmio em históricos recentes, a última vitória do Grêmio sobre o Flamengo tinha sido em 2014, de lá pra cá foram 10 jogos de invencibilidade do Flamengo e apenas uma vitória do Grêmio (a da última partida).

2- Flamengo já foi eliminado pelo Grêmio da Copa do Brasil sim, mas o Flamengo também já eliminou o Grêmio tanto da Copa do Brasil quanto da Libertadores, inclusive o Flamengo aplicou a maior goleada de uma Semifinal entre confrontos de times brasileiros em libertadores em cima do Grêmio na semifinal da libertadores de 2019 (pode pesquisar se quiser);

3- No Histórico geral o Grêmio possuí 40 vitórias e o Flamengo possuí 39;

4- Você informou que o Flamengo nunca venceu o Inter em finais, é óbvio que você não pesquisou direito pois o Flamengo foi campeão de 1987 em cima do Internacional no módulo A do Brasileiro, sem contar que o Inter já foi 3 vezes vice do Flamengo pelo Brasileirão de 87, 2009 e 2020;

5- Pra ser justo a maior sequência invicta do Grêmio sobre o Flamengo foi de 14 jogos e do Flamengo sobre o Grêmio foi de 10 jogos;

6- Uma curiosidade: Grêmio e Inter nunca foram campeões Brasileiros na era dos pontos corridos, o Flamengo já ganhou 3 vezes (2009, 2019 e 2020) portanto se ganhar esse ano será o terceiro brasileiro consecutivo, igualando o São Paulo e o Cruzeiro como os únicos tricampeões consecutivos na era dos pontos corridos;

8- A última curiosidade, Gremistas e Colorados já caíram pra segunda divisão do campeonato Brasileiro, já o Flamengo nunca foi rebaixado até hoje. E não adianta falar sobre ajuda da CBF ou de Tapetão pq, como eu disse, isso é argumento de criança.

Os três times são gigantes do futebol Sul-americano e cada um teve os seus momentos de glória e agora é a vez do Flamengo atravessar mais um ótimo momento, se você não quiser aceitar ok, mas não venha querer desmerecer a história do clube pois isso é coisa de Clubista.

Esses são dados verdadeiros, pois é assim que se argumenta sem Clubismo ou parcialidade. Blz?👍🏽

